const SLOG = true; // simple log
const checkIfContainJbPaths = (str) => {
    // The string that may be detected
    const JbPaths = [
        "/Applications/Cydia.app",
        "/usr/sbin/sshd",
        "/bin/bash",
        "/etc/apt",
        "/Library/MobileSubstrate",
        "/User/Applications/",
        "/private/var/lib/apt/",
        "/private/var/lib/cydia/",
        "substitute",
        "substrate",
        "CepheiUI"
    ];
    return JbPaths.some(item => str.includes(item));
};
